import React from "react";

import web from '../src/Images/fb2.jpg';



const Home = () =>{

    return (
    
        
        <div className="page_body">
        
        
        <section>
            <div className="content">
            <div className="tex">
            <h2>Welcome!</h2>
             <p>Here iam provided projects done by my self</p>
                </div>
                <div className= 'side_img'>
                <img  src={web} alt="imh" />
                </div>
                
             </div>




                
            
        </section>
        </div>
        
    
    )
}
export default Home;
